import React from 'react'

function SearchMovie(props) {
    return (
        <div>
            <input type="text"
                value={props.SearchValue}
                onChange={(e) => props.setSearchValue(e.target.value)}
                placeholder="Search"
            />
        </div>
    )
}

export default SearchMovie
